import React from "react";
import Button from "./Button";
import DangerButton from "./DangerButton";

function App() {
  return (
    <div>
      <Button color="green">Click Me!</Button>
      <DangerButton>Danger Button</DangerButton>
    </div>
  );
}

export default App;
